export const getTime=(index)=>{
    switch(index){
      case 1:return "من 8 الى 10 صباحا" ;
      case 2:return "من 10 الى 12 صباحا" ;
      case 3 :return "من 14 الى الرابعه زوالا " ;
      case 4:return "من الرابعه الى السادسه زوالا" ;
      default:return "";
    }
}
